import React from 'react';

import classes from './Movie.module.css';

const Movie = (props) => {

  return (
    <li  className={classes.movie}>
      <h2>{props.title}</h2>
      <h3>{props.releaseDate}</h3>
      <p>{props.openingText}</p>
      <p>{props.image}</p>
      <button  className={classes.remButton} onClick={() => props.onDeleteUser(props.id)}>Remove</button>
      <button>Edit</button>
    </li>
  );
};

export default Movie;
